content:
A Dilma perdeu meu voto pelos seguintes motivos:
a) Privatização de aeroportos;
b) Privatização de grande parte do pré-sal;
c) Importação de Médicos;
d) Gostos públicos com Copa do Mundo e Olimpíadas;
e) A CAIXA ECONÔMICA FEDERAL investi milhões em times de futotel: Corinthians, Flamengo, etc.
